import React, {Fragment} from 'react';
import spinner from './35.gif';


export default () =>(
    <Fragment>
        <img 
        src={spinner} 
        style={{width:'200px',
        margin:'auto',
        display:'block'}}
        alt='Loading...'/>
    </Fragment>
)
